INSERT INTO `berandas` (`id`, `beranda`, `tentang1`, `tentang2`, `email`, `telpon`, `alamat`, `created_at`, `updated_at`) VALUES
(1, '<div class=\"col-lg-8 align-self-end\">\r\n                            <h1 class=\"text-white font-weight-bold\">Selamat Datang</h1>\r\n                            <hr class=\"divider\" />\r\n                        </div>\r\n                        <div class=\"col-lg-8 align-self-baseline\">\r\n                            <p class=\"text-white-75 mb-5\">Layanan Bank Sampah Wirasatya</p>\r\n                        </div>', 'Bank sampah wirasatya telah berdiri sejak tahun 2014 sampai sekarang dan dikelola oleh para ibu-ibu PKK Dusun Wirasatya Desa Sidakarya, dimana Bank sampah wirasatya merupakan suatu tempat untuk pengumpulan sampah yang sudah dipilah - pilah. Saat ini Bank Sampah Wirasatya telah memiliki sebanyak 158 nasabah.', 'Menabung sampah adalah suatu gerakan yang mengajak masyarakat untuk lebih menghargai sampah sehingga mereka tidak membuang sampah secara sembarangan yang lama-kelamaan bisa merugikan dan merusak lingkungan. Anak-anak hingga dewasa (rumah tangga) diajari cara memilah sampah sesuai jenisnya. Nah, sampah yang telah dipilah di rumah tersebut bisa ditabung di bank sampah sehingga menghasilkan tabungan dalam bentuk uang.', 'banksampahwirasatya@gmail.com', '081236740860', 'Jl. Wirasatya IV No.11, Semawang, Sidakarya, Denpasar Selatan, Kota Denpasar, Bali 80224', NULL, '2022-04-11 04:46:19');
